import React, { useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import Button from "@material-ui/core/Button";
import Footer from "./elements/Footer";
import { useHistory } from "react-router-dom";


const useStyles = makeStyles((theme) => ({
  view: {
    height: "100%",
    display: "flex",
    flexDirection: "column",
  },
  sampleMedia: {
    paddingTop: "56.25%", // 16:9
  }, 
  sampleGrid: {
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
  },
  sampleContent: {
    flexGrow: 1,
  },
  
}));

function Setup(){
	let history = useHistory();
	const cards = [1, 2, 3, 4, 5, 6];
	const classes = useStyles();
	const [namesArray] = useState([
		"Servicio de Carpintería Osorio Barrio Alamos",
		"Servicio de Carpintería Barrio Ciudadela Colsubsidio",
		"Servicio de Carpintería Daytona Barrio Mirandela",
		"Servicio de Carpintería Colina",
		"Servicio de Carpintería Gómez Barrio Villaluz",
		"Servicio de Carpintería Barrio Quirigua",
	]);
	const [imgArray] = useState([
		"https://www.tumercadoclick.com/web/templates/_tmcPhotos/TMC_Z3u7uk9wp8Y7nB3tRLLcaGwI_hD85DbvXASs2pzVU_20200316213433_0.png",
		"https://d8bwfgv5erevs.cloudfront.net/cdn/13/images/curso-profesional-acabado-carpinteria-mueble_l_primaria_1.jpg",
		"data:image/jpeg;base64,",
		"https://www.carpinteriamm.com/wp-content/uploads/2018/11/lLOGO-PEQUE%C3%91O.png",
		"data:image/jpeg;base64,",
		"https://i2.wp.com/marketplacecolombiadigital.com/wp-content/uploads/2020/09/Carpinteria.jpg?fit=540%2C540&ssl=1",
	]);	
	function handleClick() {
		/* istanbul ignore next */
		history.push("/producto", {servicio: "data"});
	}
	return(
		<div>
          <h1> Encuentra todo lo que necesites referente a Carpintería:</h1>
		  <Container className={useStyles().sampleGrid} maxWidth="md">
        <Grid container spacing={4}>
          {cards.map((card) => (
            <Grid item key={card} xs={12} sm={6} md={4}>
              <Card className={classes.view}>
                <CardMedia
                  className={classes.sampleMedia}	
                  image={imgArray[card - 1]}
                  title="Titulo"
                />
                <CardContent className={classes.sampleContent}>
                  <Typography gutterBottom variant="h5" component="h2">
                    {namesArray[card - 1]}
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button size="small" color="primary" onClick={handleClick}>
                    Opina sobre el servicio
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
	  <Footer />
        </div>
		
	);
}
export default Setup;
